script: |
  super -f text -I q2095.spq | sort > q2095.out

inputs:
  - name: q2095.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE ( + 67 * + - 71 * - + col2 + col1 ) NOT BETWEEN NULL AND col0 * col0;
  - name: tab1

outputs:
  - name: q2095.out
    data: |
      59
      68
      96
